import React, { useState, useEffect } from 'react';
import xml2js from 'xml2js';

function Fixture() {
  const [fixtures, setFixtures] = useState([]);

  useEffect(() => {
    fetch('/fixtures.xml')
      .then(response => response.text())
      .then(xml => {
        xml2js.parseString(xml, (err, result) => {
          if (err) {
            console.error(err);
          } else {
            setFixtures(result.fixtures.fixture);
          }
        });
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div>
      <h1>Fixture List</h1>
      <ul>
        {fixtures.map(fixture => (
          <li key={fixture.id}>
            <p>Date: {fixture.date}</p>
            <p>Time: {fixture.time}</p>
            <p>Home Team: {fixture.homeTeam}</p>
            <p>Away Team: {fixture.awayTeam}</p>
            <p>Venue: {fixture.venue}</p>
            <p>Competition: {fixture.competition}</p>
            <p>Status: {fixture.status}</p>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Fixture;
